import React from "react";
import cities from './city-weather.json';



function CityList(){
    const citylist = cities.map(x=>x.name);

    return (
        <div>
            {citylist.map(city=>{
                <City name={city.name}/>
            })}


        </div>
    )
}

function City({name}){
    return(
        <div class="card">
            <h2>{name}</h2>
        </div>
    )

}

export default CityList;
